import React from 'react';
import { Link } from 'react-router-dom';

export default function HomePage() {
  return (
    <div>
      <h2>Page d'accueil</h2>
      <Link to="/second">
        <button>Aller à la deuxième page</button>
      </Link>
    </div>
  );
}
